一个简单的实现如下 template <typename Priority, typename Val>
class UniquePriorityQueue
{
public: void push_or_update(const Priority &p, const Val &v) { auto vp_it = _vp_map.find(v); // O(log n) if (vp_it != _vp_map.end()) { // update auto pv_it = _pv_map.find(vp_it->second); // O(log n) assert(pv_it != _pv_map.end()); _pv_map.erase(pv_it); // O(1) vp_it->second = p; _pv_map.insert({vp_it->second, vp_it->first}); // O(log n) } else { auto [vp_it, success] = _vp_map.emplace(v, p); // O(log n) assert(success); _pv_map.insert({vp_it->second, vp_it->first}); // O(log n) } } void pop() { auto pv_it = _pv_map.begin(); assert(pv_it != _pv_map.end()); auto vp_it = _vp_map.find(pv_it->second); assert(vp_it != _vp_map.end()); _pv_map.erase(pv_it); _vp_map.erase(vp_it); } const std::pair<const Priority&, const Val&> top() const { auto pv_it = _pv_map.begin(); assert(pv_it != _pv_map.end()); return {pv_it->first, pv_it->second}; } bool empty() const { assert(_pv_map.size() == _vp_map.size()); return _vp_map.empty(); }
private: std::map<Priority, const Val &> _pv_map; std::unordered_map<Val, Priority> _vp_map;
}; 之所以叫 UniquePriorityQueue，是因为队列内的 Val 是不重复的，如果一个 Val 已经存在，那么 push_or_update 的语义就是更新其优先级 各接口的复杂度为： O(1): top(), empty() O(log n): push_or_update(), pop() 以下是一个完整可编译的程序(C++20), 模拟了刚才所说的安排会话的例子 #include <map>
