private: std::map<Priority, const Val &> _pv_map; std::unordered_map<Val, Priority> _vp_map;
}; struct Job
{ int id; int i = 0; std::vector<int> schedule; Job(int id) : id(id) {} int next() { if (i < schedule.size()) { return schedule[i++]; } else { return INT32_MAX; } }
