constexpr int ITERATIONS = 1000000; int main()
{ std::srand(time(nullptr)); UniquePriorityQueue<int, std::shared_ptr<Job>> q; std::vector<std::shared_ptr<Job>> jobs; std::vector<Job *> schedule; // generate N jobs for (int i = 0; i < JOBS; i++) { jobs.push_back(std::make_shared<Job>(i)); } // tick ITERATIONS times, each tick one random job should be done, use `schedule` to record the order for (int priority = 0; priority < ITERATIONS; priority++) { auto job = jobs[std::rand() % JOBS]; schedule.push_back(job.get()); job->schedule.push_back(priority); } // init priority queue for (auto& job: jobs) { auto next = job->next(); q.push_or_update(next, job); } // tick, each tick get the job with the lowest priority, and update its priority for (int i = 0; i < ITERATIONS; i++) { printf("\rticking %d/%d", i, ITERATIONS); const auto &[p, job] = q.top(); // check if the order is correct assert(p == i); assert(job.get() == schedule[i]); // schedule next auto next = job->next(); assert(next > p); q.push_or_update(next, job); } assert(q.top().first == INT32_MAX); return 0;
